<script>
import store from '@/common/store/index.js'
import socket from '@/plugins/socket';
// #ifdef H5
import { h5Login } from '@/plugins/html5Utils';
// #endif
	export default {
		onLaunch: function() {
		//取出缓存数据
		//store.commit('setCacheData');
		// #ifdef MP-WEIXIN
		if (store.state.user.tokenInfo) {
			socket.init();
		}
		// #endif
		// #ifdef H5
		if (store.state.user.tokenInfo) {
			socket.init();
		} else {
			h5Login('force', () => {
				socket.init();
			});
		}
		// #endif
		// #ifdef APP-PLUS
		if (store.state.user.tokenInfo) {
			socket.init();
		}
		//APPUpdate();
		// #endif
		
		
		},
		onShow: function(e) {
			
			//获取二维码携带的参数
			let scene = decodeURIComponent(e.query.scene);
			scene = scene.split('&');
			let data = {
				//场景值
				scene: e.scene
			};
			scene.forEach(item => {
				let arr = item.split('=');
				if (arr.length == 2) {
					data[arr[0]] = arr[1];
				}
			});
			
			store.commit('setChatScenesInfo', Object.assign(e.query, data));
			
		},
		onHide: function() {
			console.log('App Hide')
		},

	}
</script>

